package syntaxtree;import visitor.InterpreterVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class ClassDeclExtends extends ClassDecl {  public Identifier i;  public Identifier j;  public VarDeclList vl;    public MethodDeclList ml;   public ClassDeclExtends(Identifier ai, Identifier aj,                   VarDeclList avl, MethodDeclList aml, Position p) {    i=ai; j=aj; vl=avl; ml=aml;position=p;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }    public Object accept(InterpreterVisitor v) {	  return v.visit(this);  }}